import React from "react";
import './../css/home.css';
import {Header} from "./header";
export class Home extends React.Component{
    constructor() {
        super();
        this.state = {

        }
        this.updateText=this.updateText.bind(this);
        this.sendData=this.sendData.bind(this);
    }
    updateText(event){

    }
    sendData(){

    }
    componentDidMount(){

    }
    render() {
        return (
            <div id='home'>
                <Header/>
                <div id="container">
                    <div id="foo">
                        <div>डाटाहरु सर्भरमा अपलोड गर्नुहोस </div>
                        <div>डाटाहरु सर्भरबाट डाउनलोड गर्नुहोस </div>
                        <div>डाटाहरु कम्प्युटरमा ब्याककप गर्नुहोस </div>
                    </div>
                    <div id="conclusion-ward">
                        <div className="item">
                            <b>1 नं. वडा, टुकुचे</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                        <div className="item">
                            <b>2 नं. वडा, कोबाङ</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                        <div className="item">
                            <b>3 नं. वडा, लेते</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                        <div className="item">
                            <b>4 नं. वडा, घाँसा</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                        <div className="item">
                            <b>5 नं. वडा, कुञ्जो</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                    </div>
                    <div id="report">

                    </div>
                </div>
            </div>
        );
    }
}
